import time
import requests
from bs4 import BeautifulSoup
import json
import base64
def solve(srcc):
    coded_string = ""
    
    
    svg = BeautifulSoup(srcc, 'html.parser')
    for i in svg.findAll('path'):
        if 'stroke' in i.attrs.keys():
            i.extract()
    vals = []
    for i in svg.findAll('path'):
        #if 'stroke' in i.attrs.keys():

        vals +=[int(i.attrs["d"].split(".")[0].replace("M", ""))]
        #print(vals)
    sorte = vals[:]

    sorte.sort()

    parsed_model = json.loads(base64.b64decode(coded_string))
    solution = ['','','','','']
    idx = 0
    import re
    for i in svg.findAll('path'):
        pattern = re.sub('\s|\.|\d','', i.attrs['d'])
        solution[sorte.index(vals[idx])] = parsed_model[pattern]
        idx +=1
    print("".join(solution))
    return "".join(solution)
with open ("captcha.svg", "r") as myfile:
    data=myfile.readlines()
    data = "".join(data)
    s=solve(data)